import React from 'react';


const Basket = (props) => {

    let cartList = props.cartItems.map((item,index)=>{
        return <li>{item.price} {item.name}</li>
    })

    return (

        <div className="Basket">
        <ul>{cartList}</ul>


        </div>
        )
}

export default Basket;
